import './App.css';
//import ReclamacoesComponent from './components/ReclamacoesComponent';
//import CategoriasComponent from './components/CategoriasComponent';
import React, { Component } from 'react'
import { Button, ButtonGroup, Container, Table } from 'reactstrap';
import AppNavbar from './AppNavBar';
import { Link } from 'react-router-dom';
import Home from './Home';

import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import CategoriasComponent from './CategoriasComponent';
import CategoriaEdit from './CategoriaEdit';

class App extends Component {
  render() {
    return (
        <Router>
          <Switch>
            <Route path='/' exact={true} component={Home}/>
            <Route path='/categorias' exact={true} component={CategoriasComponent}/>
            <Route path='/categorias/:id' component={CategoriaEdit}/>
          </Switch>
        </Router>
    )
  }
}

export default App;
